class Solution(object):
    def getAverages(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """
        N = len(nums)
        res = [-1 for i in range(len(nums))]
        if N < 2*k+1:
            return res

        temp = sum(nums[0:2*k+1])
        res[k] = int(temp/(2*k+1))
        for i in range(k+1,len(nums)-k):
            temp = temp - nums[i-k-1] + nums[i+k]
            res[i] = int(temp/(2*k+1))

        return res


